DROP TABLE IF EXISTS `characters`;
CREATE TABLE `characters` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(255) default NULL,
  `gender` varchar(255) default NULL,
  `max_ability_points` float default '25',
  `mind` float default '5',
  `agility` float default '5',
  `body` float default '5',
  `charisma` float default '5',
  `psychic` float default '5',
  `luck` float default '10',
  `current_life` float default '250',
  `max_life` float default '250',
  `current_mana` float default '250',
  `max_mana` float default '250',
  `char_type` varchar(255) default NULL,
  `account_id` int(11) default NULL,
  `current_exp` float default '0',
  `next_lev_exp` float default '2500',
  `level` float default '1',
  `chance_to_hit` float default '30',
  `chance_of_max_damage` float default '30',
  `chance_magic` float default '30',
  `win` float default '0',
  `lose` float default '0',
  `gold` float default '10',
  `visible` tinyint(1) default '1',
  `quest_owner_id` int(11) default '0',
  `active_quest_status` int(11) default '0',
  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  PRIMARY KEY  (`id`),
  KEY `index_characters_on_name` (`name`),
  KEY `index_characters_on_gender` (`gender`),
  KEY `index_characters_on_agility` (`agility`),
  KEY `index_characters_on_body` (`body`),
  KEY `index_characters_on_charisma` (`charisma`),
  KEY `index_characters_on_psychic` (`psychic`),
  KEY `index_characters_on_luck` (`luck`),
  KEY `index_characters_on_current_life` (`current_life`),
  KEY `index_characters_on_max_life` (`max_life`),
  KEY `index_characters_on_current_mana` (`current_mana`),
  KEY `index_characters_on_max_mana` (`max_mana`),
  KEY `index_characters_on_char_type` (`char_type`),
  KEY `index_characters_on_account_id` (`account_id`),
  KEY `index_characters_on_current_exp` (`current_exp`),
  KEY `index_characters_on_next_lev_exp` (`next_lev_exp`),
  KEY `index_characters_on_level` (`level`),
  KEY `index_characters_on_win` (`win`),
  KEY `index_characters_on_lose` (`lose`),
  KEY `index_characters_on_gold` (`gold`),
  KEY `index_characters_on_quest_owner_id` (`quest_owner_id`),
  KEY `index_characters_on_active_quest_status` (`active_quest_status`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

